  \"Biological, chemical, in situ, navigational, physical and profile data collected
  by University of Hawaii at Manoa at OceanSITES site ALOHA from 1988-10-30 to 2015-08-05
  (NCEI Accession 0129905)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-02-26T22:15:56.375378\",\n\t\"name\": \"biological-chemical-in-situ-navigational-physical-and-profile-data-collected-by-university\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Biological, chemical, in situ, navigational,
  physical and profile oceanographic data were collected, including CHLOROPHYLL, CONDUCTIVITY,
  CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V),
  DEPTH - OBSERVATION, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, LATITUDE, LONGITUDE,
  SALINITY, WATER TEMPERATURE, nitrate + nitrite content (concentration), phosphate
  and silicate from ALPHA HELIX, KA'IMIKAI-O-KANALOA, KAHO, KAIMALINO, KILA, KILO
  MOANA, KNORR, MARINE VIEW, MAURICE EWING, MELVILLE, MOANA WAVE, Moored Buoy, NA'INA,
  NESHANIC, ROGER REVELLE, THOMAS G. THOMPSON, TOWNSEND CROMWELL and WECOMA at the
  Hawaii Ocean Time-series Station ALOHA (ALOHA) using ADCP, C-T recorder, CTD, conductivity
  sensor, fluorometer, oxygen meter and pressure sensors from 1988-10-30 to 2015-08-05.
  These data were provided to one of the OceanSITES Data Assembly Centers (DAC). The
  DAC formatted this information into the OceanSITES file format and passed it on
  to the Global Data Assembly Centers (GDAC).OceanSITES is a worldwide system of long-term,
  open-ocean reference stations measuring dozens of variables and monitoring the full
  depth of the ocean from air-sea interactions down to the seafloor. It is a network
  of stations or observatories measuring many aspects of the ocean's surface and water
  column using, where possible, automated systems with advanced sensors and telecommunications
  systems, yielding high time resolution, often in real-time, while building a long
  record.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
